INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 401, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, "アヤネ", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 102301, 0.0, 0.0, 24001, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 402, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, "アヤネ", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 102301, 0.0, 2.21, 24002, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 403, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, "アヤネ", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 102301, 0.0, 0.0, 24003, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 701, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, "アサヒ", 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192201, 0.0, 1.99, 24004, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 702, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, "アサヒ", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192201, 0.0, 2.21, 24005, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 703, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, "アサヒ", 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192201, 0.0, 3.33, 24006, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 801, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, "部員３", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192301, 0.0, 0.0, 24007, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 802, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, "部員３", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192301, 0.0, 2.68, 24008, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 803, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, "部員３", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192301, 0.0, 0.0, 24009, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 501, "やった！", 1, "", 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192501, 0.0, 0.0, 24010, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 502, "勝ったよ！", 1, "", 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192501, 0.0, 0.0, 24011, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 503, "いい調子！", 1, "", 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192501, 0.0, 0.0, 24012, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 111, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, "ミサト", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, 0.0, 5.33, 24013, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 112, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, "ミサト", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, 0.0, 6.85, 24014, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 113, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, "ミサト", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, 0.0, 3.0, 24015, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 611, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, "ダイチ", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192401, 0.0, 6.11, 24016, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 612, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, "ダイチ", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192401, 0.0, 6.75, 24017, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 613, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, "ダイチ", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192401, 0.0, 0.0, 24018, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 211, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, "ハツネ", 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113401, 0.0, 4.52, 24019, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 212, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, "ハツネ", 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113401, 0.0, 3.89, 24020, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 213, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, "ハツネ", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113401, 0.0, 13.49, 24021, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 311, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, "カヤ", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 106501, 0.0, 3.17, 24022, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 312, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, "カヤ", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 106501, 0.0, 4.42, 24023, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 313, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, "カヤ", 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 106501, 0.0, 2.89, 24024, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 421, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, "アヤネ", 3, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 102301, 0.0, 3.71, 24025, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 721, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, "アサヒ", 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192201, 0.0, 5.1, 24026, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 821, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, "部員３", 3, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192301, 0.0, 4.34, 24027, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 521, "いい勝負だったよ\nまたやろうね", 1, "", 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192501, 0.0, 0.0, 24028, 10046, 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 101, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, "ミサト", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, 0.0, 5.62, 24029, 10046, -360.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 102, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, "ミサト", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, 0.0, 9.58, 24030, 10046, -360.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 103, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, "ミサト", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, 0.0, 0.0, 24031, 10046, -360.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 104, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, "ミサト", 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, 0.0, 9.13, 24032, 10046, -360.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 105, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, "ミサト", 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, 0.0, 8.27, 24033, 10046, -360.0);
